                <div className="bg-orange-400 w-1/2">
                    <h1 href="#">Hello, I am zam</h1>
                    <h3>I am software Engginner,</h3>
                </div>
                <div className="bg-red-300 w-1/2">
                    <img className="w-80 items-center" src={img} alt="muzamilH"/>
                </div>
            </div>
        </div>
    )
}
